export default function Page({ yy }) {
  const { id } = useParams();
  const product = yy.find((g) => g.id.toString() === id);

  if (!product) {
    return <div>Product not found</div>;
  }

  // Если id равен 2, отобразить определенный текст
  if (id === '2') {
    return <div>Special text for id 2</div>;
  }

  return (
    <div>
      <p>ID: {product.id}</p>
      <p>Title: {product.title}</p>
    </div>
  );
}
